import React from 'react';
import { Card } from 'react-bootstrap';
import step1 from '../img/step-one.PNG';
import step2 from '../img/step-two.PNG';
import step3 from '../img/step-three.PNG';

const HowToSteps = () => {
    return (
        <div className="">
            <Card className="how-to-steps border-0">
                <Card.Body className="mx-auto">
                    <img className="step-one m-3 mx-2" src={step1} alt="step one" />
                    <img className="step-two m-3 mx-2" src={step2} alt="step two" />
                    <img className="step-three m-3 mx-2" src={step3} alt="step three" />
                </Card.Body>
            </Card>
        </div>
    );
}
 
export default HowToSteps;
